import React, { Fragment, useEffect } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
// import PostItem from '../posts/PostItem';

import ImmunizeItem from '../immunize/ImmunizeItem';
import ImmunizeForm from '../immunize/ImmunizeForm';
import { getImmunizes } from '../../actions/immunize';

const Immunizes = ({ getImmunizes, immunize: { Immunizes } }) => {
  useEffect(() => {
    getImmunizes();
  }, [getImmunizes]);

  return (
    <Fragment>
      <ImmunizeForm />
      <div className="post">
        {Immunizes.map((immunize) => (
          <ImmunizeItem key={immunize._id} immunize={immunize} />
        ))}
      </div>
    </Fragment>
  );
};

Immunizes.propTypes = {
  getImmunizes: PropTypes.func.isRequired,
  immunize: PropTypes.object.isRequired
};

const mapStateToProps = (state) => ({
  immunize: state.immunize
});

export default connect(mapStateToProps, { getImmunizes })(Immunizes);
